import React, { useState } from 'react';
import { Mail, ArrowRight, CheckCircle } from 'lucide-react';

const EmailCollection = ({ onEmailSubmitted, isVisible }) => {
    const [email, setEmail] = useState('');
    const [isValid, setIsValid] = useState(true);
    const [isSubmitted, setIsSubmitted] = useState(false);

    const validateEmail = (email) => {
        const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        return emailRegex.test(email);
    };

    const handleEmailChange = (e) => {
        const value = e.target.value;
        setEmail(value);
        if (value === '') {
            setIsValid(true);
        } else {
            setIsValid(validateEmail(value));
        }
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (validateEmail(email)) {
            setIsSubmitted(true);
            // Store email in localStorage
            localStorage.setItem('userEmail', email);
            onEmailSubmitted(email);
        } else {
            setIsValid(false);
        }
    };

    if (!isVisible) return null;

    if (isSubmitted) {
        return (
            <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
                <div className="bg-white rounded-2xl p-8 max-w-md w-full mx-4 shadow-2xl animate-fade-in-up">
                    <div className="text-center">
                        <div className="bg-green-100 rounded-full p-4 w-16 h-16 mx-auto mb-4">
                            <CheckCircle className="text-green-600 mx-auto" size={24} />
                        </div>
                        <h2 className="text-xl font-semibold text-gray-900 mb-2">Email Verified!</h2>
                        <p className="text-gray-600 text-sm mb-4">
                            Thank you for providing your email. You can now proceed with providing feedback.
                        </p>
                        <div className="bg-gray-50 rounded-lg p-3">
                            <p className="text-sm text-gray-700">
                                <span className="font-medium">Email:</span> {email}
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }

    return (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
            <div className="bg-white rounded-2xl p-8 max-w-md w-full mx-4 shadow-2xl animate-fade-in-up">
                <div className="text-center mb-6">
                    <div className="bg-blue-100 rounded-full p-4 w-16 h-16 mx-auto mb-4">
                        <Mail className="text-blue-600 mx-auto" size={24} />
                    </div>
                    <h2 className="text-xl font-semibold text-gray-900 mb-2">Welcome to Font Evaluator</h2>
                    <p className="text-gray-600 text-sm">
                        Please enter your email address to proceed with providing feedback on font recommendations.
                    </p>
                </div>

                <form onSubmit={handleSubmit} className="space-y-4">
                    <div>
                        <label htmlFor="email" className="block text-sm font-medium text-gray-700 mb-2">
                            Email Address
                        </label>
                        <div className="relative">
                            <input
                                type="email"
                                id="email"
                                value={email}
                                onChange={handleEmailChange}
                                className={`w-full px-4 py-3 border rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors ${!isValid ? 'border-red-300 bg-red-50' : 'border-gray-300'
                                    }`}
                                placeholder="Enter your email address"
                                required
                            />
                            {!isValid && (
                                <p className="text-red-500 text-xs mt-1">
                                    Please enter a valid email address
                                </p>
                            )}
                        </div>
                    </div>

                    <button
                        type="submit"
                        className="w-full bg-blue-600 hover:bg-blue-700 text-white font-medium py-3 px-4 rounded-lg transition-colors flex items-center justify-center space-x-2"
                    >
                        <span>Proceed with Feedback</span>
                        <ArrowRight size={16} />
                    </button>
                </form>

                <div className="mt-6 text-center">
                    <p className="text-xs text-gray-500">
                        Your email will be stored securely and used only for feedback tracking purposes.
                    </p>
                </div>
            </div>
        </div>
    );
};

export default EmailCollection;
